import React from 'react'
import Canvas from './Canvas'

function App() {
  const draw = ctx => {
    ctx.beginPath();
    ctx.arc(200, 200, 20, 0, Math.PI * 2);
    ctx.fillStyle = 'black';
    ctx.fill();
  }

  return <Canvas draw={draw}/>
}

export default App
